import React from 'react';

export function UserGreeting(props) {
    alert("-----> Greeting => user: " + props.user)
    return <span className="greet">Welcome back {props.user}!</span>;
}

export function GuestGreeting(props) {
    return <span className="greet">Sign up...</span>;
}

export default function Greeting(props) {
    const isLoggedIn = props.isLoggedIn;
    const user = props.user;
    alert("Greeting => user: " + user)
    if (isLoggedIn) {
        return <UserGreeting user={user}/>;
    }
    return <GuestGreeting user={user}/>;
}
